import React, { useState } from 'react';
import {
  Container, Typography, TextField, Button, Grid, IconButton, Box
} from '@mui/material';
import { AddCircle, RemoveCircle } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

const CreateProjectPage = () => {
  const navigate = useNavigate();
  const [tripName, setTripName] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [groupMembers, setGroupMembers] = useState([{ name: '', email: '' }]);

  const handleSave = async () => {
    const customer_id = localStorage.getItem('customer_id');
    if (!customer_id) {
      alert('Please login first');
      navigate('/login');
      return;
    }

    const response = await fetch('http://localhost:5000/create-trip', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        customer_id,
        trip_name: tripName,
        start_date: startDate,
        end_date: endDate,
        group_members: groupMembers
      })
    });

    if (response.ok) {
      alert('Trip saved!');
      navigate('/dashboard');
    } else {
      alert('Failed to save trip.');
    }
  };

  const updateMember = (index, field, value) => {
    const updated = [...groupMembers];
    updated[index][field] = value;
    setGroupMembers(updated);
  };

  const addMember = () => setGroupMembers([...groupMembers, { name: '', email: '' }]);
  const removeMember = (index) =>
    setGroupMembers(groupMembers.filter((_, i) => i !== index));

  return (
    <Container maxWidth="sm" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>Create New Trip</Typography>
      <TextField
        fullWidth
        label="Trip Name"
        value={tripName}
        onChange={(e) => setTripName(e.target.value)}
        sx={{ mb: 2 }}
      />
      <TextField
        fullWidth
        label="Start Date"
        type="date"
        InputLabelProps={{ shrink: true }}
        value={startDate}
        onChange={(e) => setStartDate(e.target.value)}
        sx={{ mb: 2 }}
      />
      <TextField
        fullWidth
        label="End Date"
        type="date"
        InputLabelProps={{ shrink: true }}
        value={endDate}
        onChange={(e) => setEndDate(e.target.value)}
        sx={{ mb: 2 }}
      />

      <Typography variant="h6" sx={{ mt: 3 }}>Invite Travellers</Typography>
      {groupMembers.map((member, idx) => (
        <Grid container spacing={1} alignItems="center" key={idx} sx={{ mb: 1 }}>
          <Grid item xs={5}>
            <TextField
              fullWidth
              label="Name"
              value={member.name}
              onChange={(e) => updateMember(idx, 'name', e.target.value)}
            />
          </Grid>
          <Grid item xs={5}>
            <TextField
              fullWidth
              label="Email"
              value={member.email}
              onChange={(e) => updateMember(idx, 'email', e.target.value)}
            />
          </Grid>
          <Grid item xs={2}>
            <IconButton onClick={() => removeMember(idx)}>
              <RemoveCircle />
            </IconButton>
          </Grid>
        </Grid>
      ))}
      <Button
        variant="outlined"
        startIcon={<AddCircle />}
        onClick={addMember}
        sx={{ mb: 3 }}
      >
        Add Traveller
      </Button>

      <Box textAlign="center">
        <Button variant="contained" onClick={handleSave}>Save Trip</Button>
      </Box>
    </Container>
  );
};

export default CreateProjectPage;
